import React, { Fragment, useContext } from 'react';
import ContactContext from '../../context/contact/contactContext';

const Contacts = () => {
    const { contacts } = useContext(ContactContext);
    return (
        <Fragment>
            {contacts.map(contact => (
                <h3>{contact.name}</h3>
            ))}
        </Fragment>
    );
};

export default Contacts;
